pragma solidity = 0.8.0;
import './Token.sol';

contract RockPaperScissors {
    Token public token;
    struct Game {
        uint256 timeStamp;
        uint256 tokenAmount;
        address winner;
        address opponent;
        }
    mapping(address => Game) public gameList;
    constructor(Token _token){
        token=_token;
    }


     /* Freeze tokens
    */
    function freezeTokens(uint256 _tokenAmount) public returns(bool){
        token.transferFrom(msg.sender,address(this), _tokenAmount);
        return true;
    }

     /* ReleaseTokens
    */
    function releaseTokens(uint256 _tokenAmount) public returns(bool){
        token.transfer(msg.sender, _tokenAmount);
        return true;
    }


    /* Creates a new game
       while freezing _tokenAmount
       and add it to the game list
    */
    function newGame(uint256 _tokenAmount) public returns(bool){
        require(
        (gameList[msg.sender].timeStamp+120<block.timestamp),"You have already a game initialized");

        Game memory _newGame=Game(block.timestamp,_tokenAmount,address(0x0),address(0x0));
        freezeTokens(_tokenAmount);
        gameList[msg.sender]=_newGame;
        return true;
    }

    function withDrawTokens() public returns(bool){
        require(gameList[msg.sender].tokenAmount!=0,"You not have tokens to withdraw");
        Game memory game=gameList[msg.sender];
        releaseTokens(game.tokenAmount);
        return true;
    }

}
